var $bm_rt;
var maxDev, spd, decay, t, x, y;
maxDev = 5;
spd = 8;
decay = 1;
t = sub(time, inPoint);
x = sum($bm_transform.scale[0], div(mul(maxDev, Math.sin(mul(spd, t))), Math.exp(mul(decay, t))));
y = div(mul($bm_transform.scale[0], $bm_transform.scale[1]), x);
$bm_rt = [
    x,
    y
];
